import React from 'react';
import { useNavigate } from 'react-router-dom';
import './WalletConnector.css';

const WalletConnector = () => {
  const navigate = useNavigate();

  const handleConnectWallet = () => {
    // Ton cüzdan bağlantı işlemleri burada yapılacak
    console.log('Ton cüzdan bağlanıyor...');
    // Bağlantı başarılı olduğunda ana sayfaya yönlendirme yapabilirsiniz
    navigate('/home');
  };

  return (
    <div className="wallet-connector-container">
      <h1>Ton Wallet Connector</h1>
      <p>Lütfen cüzdanınızı bağlayın.</p>
      <button className="connect-wallet-button" onClick={handleConnectWallet}>
        Cüzdan Bağla
      </button>
    </div>
  );
};

export default WalletConnector;
